import React from 'react';
import './Hauptseite.css';

function Hauptseite() {
    return (
        <><p className="Überschrift">Sonnenhus Breege</p>
        <p className="Untertitel">Ferienwohnungen auf Rügen</p>
        <p>Hier ist der Text, der unter der zukünftigen Komponente erscheinen soll.</p></>
    );
}

export default Hauptseite;
